import { Route, Router, Routes } from 'react-router-dom';
import './App.css';
import Header from './Header/Header';
import Main from './Main/Main';

function App() {
  return (
    <Router>
      <div>
        <Header />
        <Routes>
          <Route path='/' element={<Main/>}/>
        </Routes>
      </div>
    </Router>
  )
}

export default App;
